  return (
    <div>
      <div className={props.isSmall ? 'small-card' : 'my-card'} style={{ backgroundImage: `url('/assets/images/rain-2.jpg')` }}>
        <div className='card-header'><h3 className='brand'>{props.title}</h3>

        

        </div>

      </div>
    </div>
  )
}

export default Weather;
